import {firebase} from "./firebase-manager";

const db = firebase.firestore();
export default async function PostThumbNail(team, url, thumbUrl) {
    await db.collection('admin').doc('thumbNail').collection(`${team}`).doc(`${url}`).set({
        thumbUrl
    })
}
